<h4>Markup Contract</h4>
<br>
<div><p>data-macro-cli-click</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will execute as a CLI command with the text contents of its value.</p><br></aside>
<div><p>data-macro-prompt-fill-click</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will populate a prompt with the text contents of its containing element (slot). The user may then edit and tap Send.</p><br></aside>
<div><p>data-macro-tooltip</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will appear underlined, and render a floating tooltip containing its value, when tapped or clicked. See component for options.</p><br></aside>
<div><p>data-macro-nudge-preference</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will make one or more buttons in a nudge array blue. Indicating a default or preference.</p><br></aside>
<div><p>data-macro-cell-click</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will execute as a follow-up snapshot request with the text contents of its value.</p><br></aside>
<div><p>data-macro-feature-display</p><div><aside><p class="txt-read__legal txt-read__theme--light">This attrib will make visible its element depending on the current setting of the feature flag in the text contents of its value (see feature flags).</p><br></aside>
